36</a>, het jaar dat de Utrechtse universiteit werd opgericht, werd de Stadsbibliotheek Utrecht op het <a title="Janskerkhof" href="https://nl.wikipedia.org/wiki/Janskerkhof">Janskerkhof</a> tevens Universiteitsbibliotheek. In <a title="1820" href="https://nl.wikipedia.org/wiki/1820">1820</a> verhuisde de Universiteitsbibliotheek naar het <a title="Paleis van Lodewijk Napoleon (Utrecht)" href="https://nl.wikipedia.org/wiki/Paleis_van_Lodewijk_Napoleon_%28Utrecht%29">voormalig paleis</a> van <a class="mw-redirect" title="Koning Lodewijk Napoleon" href="https://nl.wikipedia.org/wiki/Koning_Lodewijk_Napoleon">koning Lodewijk Napoleon</a> aan de <a title="Wittevrouwenstraat" href="https://nl.wikipedia.org/wiki/Wittevrouwenstraat">Wittevrouwenstraat</a> 7-11. De collectie raakte in de loop van tijd door de groei van de universiteit over diverse vestigingen in de stad Utrecht verspreid. In 2002 verhuisden in totaal 4,2 miljoen boeken naar een nieuw gebouw op <a title="De Uithof (Utrecht)" href="https://nl.wikipedia.org/wiki/De_Uithof_%28Utrecht%29">De Uithof</a>, dat door <a title="Wiel Arets" href="https://nl.wikipedia.org/wiki/Wiel_Arets">Wiel Arets</a> is ontworpen.</p>|n|<p>De bibliotheek bezit een collectie handschriften, oude drukken en landkaarten, ondergebracht in de <em>bijzondere collecties</em>. Een topstuk uit de collectie is het <a title="Utrechts Psalter" href="https://nl.wikipedia.org/wiki/Utrechts_Psalter">Utrechts Psalter</a>.</p>";}}